(13, '9329375443', 'gupta.shubham0706@gmail.com', 'Smart Driving Mode Application', 'Proof_of_Concept', 'We dont have any website.', 'Transportation', '3', '2018', 'Problem Statement: To minimize the risks of road accidents while attending mobile phone during driving, Enablement of Drive-Mode application for Road Safety.\r\nSolution:- We are calculating the speed of the user using GPS.\r\nIf the application detects the geo coordinates are changing at the speed of more than 20 Km/hr then it starts blocking the incoming calls. Our application is able to create the call logs of the blocked calls and also to send an sms to the caller to notify them about the callee.', 'Team Leader:- Shubham Gupta\r\nTeam Member 1:- Tarun Dubey\r\nTeam Member 2:- Vipin Shrivatri', 'B2C', 'We are in competition with the driving mode Apps that allow the user to drive safely when enabled the smart drive mode. The most common feature they all have is if the smart drive mode is enabled they start blocking the incoming calls even when user is not driving which is a drawback. Here we came up with a solution with more advance features in our App that is we are calculating the speed of the mobile phone user through GPS and blocking the incoming calls only when user is driving.', 'I_dont_have_any_investor_commitments_for_my_startup', '5-6', '2019-04-03 19:12:07', 'on', 'Jabalpur', 482002, 'Madhya Pradesh', ''),
