(37, '7489495357', 'sandhyaborkar@gmail.com', 'Organic Dolchi', 'Early_Revenues', 'organic soochi.com', 'Other', '5', '2015', 'To save our mother earth and our water resources to get extinct we are promoting products which don\'t contain chemical fertilizers and pesticides.\r\nThis keeps the natural taste intact with the produce.\r\n', 'Me and co founder Mr Anurag Agrawal are having business experience of around 20years in different fields.', 'B2C', 'Our aim is to save our natural resources from getting contaminated and providing 100% adulteration free produce to the end users. We are different because our main Motto  is to protect natural resources than to earn money.', 'I_dont_have_any_investor_commitments_for_my_startup', '25 ', '2019-05-27 15:40:00', 'on', 'Jabalpur', 482008, 'Madhya Pradesh', ''),
