(39, '8823058867', 'jainamewaste@gmail.com', 'Jainam E-waste Solutions', 'Proof_of_Concept', 'Kamaniya gate, Panagar', 'Other', '9', '2018', 'We aspire to setup an Electrical and Electronic waste dismantling and recycling facility in jabalpur which will focus on safe and formal recycling. We will provide data destruction, reverse logistics, yearly contract services to IT companies etc. We will extract the metals such as copper, aluminium, gold, silver etc. and materials like plastic, glass, fiber glass etc. from the E-Waste and sell it to their respective market.', 'Ayushmaan Badkul (B.tech civil- VIT university, vellore)\r\nDev Kumar Sodhiya (B.tech CSE- Amity University, Jaipur)\r\nAdish Jain (BBA- Symbiosis, Noida)', 'B2B', 'As of now there is no formal E-waste Recycling facility in jabalpur. Surprisingly,  jabalpur produces around 450 kg of E-waste on daily basis and almost all of it is recycled by illegal methods which is harmful for flora and fauna.\r\nGovernment of india promotes the formal recycling of E-waste and being the lone player in this field we have the upper hand of maximum recycling  opportunities, also being the authorized dismantler and recycler we are the only who can provide the certification.', 'I_dont_have_any_investor_commitments_for_my_startup', '200', '2019-06-10 20:29:48', 'on', 'Jabalpur', 483220, 'Madhya Pradesh', ''),
(40, '7000774779', 'sonivaishali666@gmail.com', 'Bike pooling', '1', 'An android applicatiom', 'Information Technology', '6', '2019', 'It is bike pooling system where we can provide a person is driver Or pillion too at A time.In this system we provide a bike sharing with minimum cost. ', 'We are two members in the team', 'B2B', 'Only because of their security purpose. This system is failed because they didn\'t gives the proper security to the pillion. So we provide a spam where dial 100, gps system to locate the location of that person and a family member mobile no.  To inform he/she is in danger. Before we choose for lift you have to select that driver is male /female or on the basis of the profession. So this may gives you more comfortable ride as much you want and their security also. ', 'I_dont_have_any_investor_commitments_for_my_startup', '100000', '2019-06-13 00:12:49', 'on', 'Jabalpur', 0, 'Madhya Pradesh', ''),
