(44, '9893566007', 'info@getinfosystems.com', 'Edueye Smart Solution ', 'Early_Revenues', 'www.edueye.in', 'Information Technology', '0', '2017', 'Edueye Smart Solution.\r\nBeautifully designed and intelligently developed EDUEYE Management System for schools, colleges, coaching centers or any other educational institute it also includes a powerful Android App for PARENTS, STUDENTS, and MANAGEMENT.  Our Solution Of Management & Security with RFID/UHF attendance system is a\r\nA great solution that will keep you managed', 'Naresh Choudhary (Founder), is having an experience in the software industry since last 10 years.\r\n\r\nShrikant Vishwakarma ( Operations Head ), is having an experience of 9 years for operating the businesses and now he is the Operation Head of Edyeye Smart Solutions since last 2 years.', 'B2B', 'We have designed and developed this software with fully secured management system with automated attendance. Because nowadays children are our most resource and have to safe. So we used RFID Technology with it for automatic attendance for child safety with awareness and vigilance along with sensitivity.  Which managed in a secure way.  ', 'I_dont_have_any_investor_commitments_for_my_startup', '90 ', '2019-06-26 19:52:42', 'on', 'Jabalpur', 482001, 'Madhya Pradesh', ''),
(45, '7974771186', 'mail@khushkool.com', 'Khushkool INC', '1', 'www.khushkool.com', 'Social welfare and development', '0', '2019', 'Khushkool is a platform for everyday individuals which focuses on building a peer to peer mental wellness community, promoting awareness, healthy discussions and life coaching for the ones in need. A daily dose of positivity.', 'There are two people in the team who seeded the idea for the project - Khushkool Khosla (CEO/CO-founder) and Adarsh Shandilya (Co-founder). ', 'Others', 'Khushkool is not just an awareness program, it is a concrete startup idea to focus on the mindful moments and help people detect mental issues at an early stage and provide a suitable solution for further prevention without the use of any medication/expensive consultancy but by mere awareness and solution which can be taken care at the individual levels at very affordable next to negligible costs. It basically focuses on making people feel about themselves & make them feel wanted or important.', 'Others', '1-3', '2019-06-27 15:14:13', 'on', 'Jabalpur', 482008, 'Madhya Pradesh', ''),
(46, '9771362415', 'siddhartha.shekhar08@gmail.com', 'Gethomenow', '1', 'www.gethomenow.com', 'Information Technology', '5', '2019', 'Get home now is the platform for the people who is looking for rental home without paying brockrage charge..\r\nThe rental market size is bigger in india. Our aim to provide brockrage free rental services to tenant as well as property management for  property owner.\r\n', 'Siddhartha shekhar  \r\n9771362415 ', 'B2C', 'Right now if any tenant wants to find home they have to provide brockrage fee [ 50 % of first month rent], at get home now we are not taking brockrage fee from tenant so tenant don\'t have any other liblity to provide extra money apart from rent or security.\r\n', 'Others', '5', '2019-07-02 12:43:55', 'on', 'Jabalpur', 452001, 'Madhya Pradesh', ''),
