(53, '7999461069', 'narmadajbp@outlook.com', 'Narmada Agri-infra', '1', 'https://narmadajbp.wixsite.com/index', 'Agriculture', '5', '2019', 'Narmada agri Infra is based on agro products and advance technology used in farming. the idea is to make \"Pre-fabricated Structures\" and \"IoT device\" we are able to grow the income of farming by 2x. Pre-fabricated structures made possible to increase the land capacity and with the help of \"IoT devices\" farmer are able to control and detect the crop from their laptop/phone by sitting any place of the world.', 'Team -:\r\n1. Muditya raghav is very ambitious entrepreneur and a software engineer. muditya having a very good communication skill which help company to communicates with all the 3rd-parties and also having a good command on Advanced Technologies which directly help for company\r\n\r\n2.Tanishq banger - Tanishq is very in sale and marketing.he know to sale the product and always will to grab the opportunity fast as possible . with there skill he will able to provide clients and make trust in the market.', 'B2C', 'We used very advance technology for the farming structure(Pre-fabricated Structures) and IoT device for the farmers in  fast and easy way. in India, our startup is alone and our main competitor comes from \"China and Israel\" because they are very advanced but we will beat them in next year.', 'I_dont_have_any_investor_commitments_for_my_startup', '10', '2019-07-16 08:28:45', 'on', 'jabalpur', 482001, 'Madhya Pradesh', ''),
