(55, '9424625522', 'juhi5360@gmail.com', 'Dr. Juhi Sharma , Aradhna Patel and Radhika Kurmi ', 'Proof_of_Concept', 'http://staloysiuscollege.ac.in/new/', 'Social welfare and development', '2', '2019', 'In rural areas, women do not have access to sanitary products or they know very little about the types and method of using them or are unable to afford such products due to high cost. So, they mostly rely on reusable cloth pads which they wash and use again. Needs and requirements of the adolescent girls and women are ignored despite the fact that there are major developments in the area of water and sanitation. Women manage menstruation differently when they are at home or outside; at homes, th', 'Dr. Juhi Sharma, Assistant Prof. St. Aloysius College. PhD in Microbiology,\r\nAradhna Patel and Radhika Kurmi belong to rural area and could understand and serve their requirement better. they are working for this project as they have themselve faced and seen nearby people facing this problem. \r\n they are Msc in microbiology', 'Others', 'One of the major concerns of disposable pads is its non-biodegradability which increases generation of menstrual waste which ends up in leaking into nature and polluting rivers .Also it causes occupational hazard as the used pads are to be picked up by waste pickers by their bare hand. This problem can be elevated by developing the biodegradable menstrual pad. Sanitary products with blood of an infected women/girl may contain hepatitis and HIV viruses where their infectivity live up to 6months a', 'I_dont_have_any_investor_commitments_for_my_startup', '0.5', '2019-07-18 14:41:01', 'on', 'Jabalpur', 482002, 'Madhya Pradesh', ''),
