(208, 'PICK A BOOK', '', 'Our start-up basically consists of 2 projects. First, the trading of books; second, the online platform. The first part includes renting, re', 'The problems are high prices, unavailability of the books, inaccessibility to the library resources and less recognition to the budding content creators. The platform provides solution by trading of books by presenting them at the comfort of your home. Also, the online platform would help people to ', 'Idea', 'January', 2021, '', '482005', 'Digital Solutions ', 'Madhya Pradesh', 'Jabalpur', 'Arindam Upadhyay', '9358677079', '20bec018@iiitdmj.ac.in', '', 'https://jicjabalpur.org/HackFest/jabalpur/2021/uploads/PICK-A-BOOK Abstract (HackFest).pdf', ''),
(209, 'DocConsultance', 'https://gentle-inlet-59803.herokuapp.com/', 'The idea of startup project is to enable smart services in the healthcare sector, by providing assistance to patients using AI chatbot, and ', 'Is it really worth going to hospitals and clinics just for the sake of getting appointments? Do you need to visit doctor for small problems like minor headache? The answer of all such problems will be NO with the help of our startup web application (link - https://gentle-inlet-59803.herokuapp.com/ )', 'Customer', 'December', 2020, '', '462039', 'Smart Health Solutions ', 'Madhya Pradesh', 'Bhopal', 'Anmol Saxena', '8109814987', 'saxena.anmol012@gmail.com', '', 'https://jicjabalpur.org/HackFest/jabalpur/2021/uploads/DocConsultance.pptx', 'yes'),
