(11, 'jeetendra', 'pathak', 'cinfy', 'software', 'abhishekranwat09536@gmail.com', 'jeetendra', 0, 'Bhopal', '2020-04-23'),
(12, 'Shahzad', 'Khan', 'Commonwealth Local government Forum', 'Project Manager, Madhya Pradesh Local Economic Dev', 'shahzadkhan1961@gmail.com', 'I am working closely with Jabalpur Smart City Incubation startups and I can understand the srverity and challenges facing by many start ups in Madhya Pradesh due to Covid 19.', 0, 'Bhopal', '2020-04-24'),
(13, 'DR ANURAG S D ', 'RAI', 'AIC RNTU FOUNDATION', 'EXECUTIVE OFFICER', 'rai.anurag71@gmail.com', 'WE ARE AIM SUPPORTED INCUBATION CENTER ENABLING STARTUP ECO SYSTEM OF NATION', 0, 'BHOPAL', '2020-04-24'),
(14, 'Balkala', 'Geet', 'Jaldiaao', 'Founder', 'jaldiaao1522@gmail.com', 'We provide household services door to door like cleaning ,Electrician, plumber, Gardener etc but due to covid 19 we don\'t serve our services so it is at starting stage for my venture and I suffer ', 0, 'Bhopal', '2020-04-24'),
(15, 'Nikhil', 'Bhatnagar', 'Homeguruji.com', 'Founder', 'nikhilbhatnagar2408@gmail.com', 'Because of this pandemic we are working on the offline mode of teaching in the field of home tuition,but now we are doing it online. For all this online move we need the funds so that we can continue our services in this corona pandemic.', 0, 'Jabalpur', '2020-04-24'),
(16, 'Palash', 'Goil', 'Student', 'Student', 'palash.goyal25@yahoo.com', 'As a student, I can understand how if start-up\'s in India fail then we will have limited opportunities for training and placements.', 0, 'Bhopal', '2020-04-24'),
(17, 'Siddhartha ', 'Shekhar ', 'Gear up marketing', 'Ceo', 'siddhartha.shekhar08@gmail.com', 'Hello sir \r\nWe are bootstrapping startup from tier 2 city, having the team size of 10+ employee . \r\nIn current market situation our cash flow is totally stopped, we don\'t have any other way to crosscut the expense, we have to pay to our employees but we didn\'t get any support from goverment side ,atleast create some package for Startups too , other wise 20-40% of bootstrap startup will dead and 10-20% employee will be jobless ..\r\n', 0, 'Jabalpur ', '2020-04-25'),
(18, 'Bikesh ', 'Goyal ', 'Tiffin31 ', 'Founder and ceo ', 'vickeygoyal355@gmail.com', 'I have starup named tiffin31 and due to covid 19 i am not able to run my startup. And not able to provide our survices. ', 0, 'Bhopal ', '2020-04-25'),
