(111, 'Hanna Brown', 'Hanna Brown', 'Hanna Brown', 'Your business after Covid19', 'chitchatchannel01@gmail.com', 'The world after COVID19 is shaping up. Businesses that had virtual platforms performed best. The future will be more of the same. https://ChitChatChannel.com fills that gap by providing you with a Social Business Page— like Facebook, but which plugs into its own real-time ordering /shipping system, instantly creating an additional outlet for your business. It has other corporate features like its own \'zoom\' or CHAD for Agile Tech Development. \r\nSo, whatever your business: Restaurateur, Influence', 0, 'Boston', '2021-03-17'),
