(77, '8652747408', 'firasatchishti7@gmail.com', 'Shift Bombay', '1', 'house no. 2704/1 anand nagar adhartal', 'Other', '5', '2019', 'Shift Bombay is a series of workshop on film making with career oriented approach \r\n', 'team consists of a mentor to guide through the course and guest lectures and other dignitaries who interact with candidates and reply to their queries \r\n', 'B2C', 'Shift Bombay is totally new concept since all other film schools and workshops focus on the technicalities of filmmaking, in SB we thoroughly focus on how and who candidates should approach in the industry to get work, since unlike other industries film industry possesses a very different working culture. Shift Bombay provides them that bridge and job assistance, so a candidate ultimately could reach a position where he can actually invest his energy into creative stuff\r\n', 'I_dont_have_any_investor_commitments_for_my_startup', '200000', '2019-07-23 12:08:09', 'on', 'jabalpur', 482004, 'Madhya Pradesh', ''),
