(79, '9425465122', 'motomisrty@gmail.com', 'Motomistry', 'Beta_Launched', 'http://motomistry.com/', 'Other', '5', '2019', 'Motomisrty is your vehicle companion. we are serving in automobile industry. motomistry is tech based startup who provide doorstep services like driving school , vehicle wash & servicing. we have an e-commerce platform for car accessories, genuine spare parts & for more products.\r\nour services are based on android application.', '1.suyash shrivastava ( civil engineer )\r\n2. ashwin gayakwad ( B.com, M.B.A in marketing )\r\n3. himanshu agrawal (B.COM in computer science )\r\n4. ayush mehre ( B.E. in  computer science )\r\n5. anand rajak ( M.C.A )', 'B2C', 'we are working in industry where no one is performing with technology so we can scale up our services with vendor tie up model. our worse case scenario is best case scenario  for our competitors.', 'I_want_to_fund_raise_and_dont_know_what_to_do', '500000', '2019-07-24 13:01:02', 'on', 'JABALPUR', 482003, 'Madhya Pradesh', ''),
(80, '7000602830', 'anujchoubey01@gmail.com', 'Glocal Plaza', '1', 'glocalplaza.com', 'Information Technology', '5', '2019', 'Providing online business platform and services, including software as a service (Saas) to small and medium business owners, providing food delivery service, dispatch of goods and grocery products (including daily needs of goods and services) to end customers through mobile application and web platform. Design, development, updation and management of downloadable and non downloadable software namely mobile application and web services.', '1. ANUJ CHOUBEY (involve in day to day operations of startup, team building activities, UX designing) \r\n2. HARSHUL VISHWAKARMA (Technical team)\r\n3. ASHISH SAKET (Marketing management)\r\n4. ATUL GUPTA (Marketing management)\r\n5. DEVENDRA SONWANE (Stock management)\r\n', 'B2B', 'In this modern world full of tech-startups, we understand our competition  with various competitor in this field  but the main problem as we understood with most of these startup is their centralize system of working we believe in CITY CENTRIC HYPER LOCAL SOLUTIONS  , we all aware with distress in local traditional market because of online shopping apps we believe our startup will work to reduce this distress, it will provide online platform for local market.', 'I_dont_have_any_investor_commitments_for_my_startup', '5,00,000/-', '2019-07-25 16:25:46', 'on', 'Jabalpur', 482001, 'Madhya Pradesh', ''),
