(82, '7583839911', '4s.jabalpur@gmail.com', 'SWYAM SEVARTH, SARVA SEVARTH (4\'S Group)', '1', 'Under Development', 'Social welfare and development', '3', '2019', 'We at 4\'S, is working on creating a \"Single Window System\" and an \"Open Platform\" for any Enterprise to run their specified business in a Systematic and Organized way for their continuous Upliftment and Growth. We will do this by creating a Bridge between different Enterprises and the expert Professionals and Associations, through various technological and personal manual support.', 'We are having a team of individuals and groups, working indifferent fields for providing services, support and solutions, to run any Enterprises, at their different levels of working.', 'Others', 'We are an Open Platform for creating and connecting different Enterprises with Expert Professionals and Departments, through our dedicated efforts of creating the raw data of any Enterprise, in a processed form, for their easy and fast implementation, with the use of different technological support for their solutions, as a working partners for them.', 'I_want_to_fund_raise_and_dont_know_what_to_do', '', '2019-07-28 15:57:34', 'on', 'Jabalpur', 482002, 'Madhya Pradesh', ''),
(83, '6232011101', 'info@omezyo.com', 'Omezyo Ecom Solutions Pvt. Ltd', 'Beta_Launched', 'www.omezyo.com', 'Information Technology', '3', '2019', 'Omezyo is android based application which provider digital store to different  local vendors from different sectors including services and provide them to the subscribers on day to day basis, it also includes offer & discount available. It gives free listing for vendors and charge from its subscribers . Its more of a personalized information about the offer. Subscribers get opportunity to earn cash back by referring friends and family  members.', 'Richa Jain - Founder Omezyo \r\nShobit Samaiya - Founder Omezyo\r\nDavis Swamy - Co Founder Omezyo', 'B2C', 'We Collect discount Vouchers and Offer Vouchers and provide it to our subscribers based on the interest ,requirement and location updated on the OMEZYO  mobile application. Omezyo is Pan India based and it covers sectors which are used on daily basis by any average Indian family for an example , Health ( It provides discount Vouchers from brands like Ranbaxy / Raligare / Thyrocare Local diagnostics centers) Automobile ( It provides discount vouchers from Local Car servicing center & Tyre Care)  ', 'I_dont_have_any_investor_commitments_for_my_startup', '10', '2019-07-29 14:41:02', 'on', 'Jabalpur', 482002, 'Madhya Pradesh', ''),
