(122, '9981096722', 'support@yaru.co.in', 'Yaru - Get Things Done', 'Early_Revenues', 'www.yaru.co.in', 'Other', '4', '2019', 'Yaru is a 24x7, on-demand delivery service app that helps you save time and money. Available in Jabalpur(M.P). Yaru wizards can get \"anything\" delivered at your doorstep in less than 60 minutes. What Yaru can do for you?we can get delicious food from restaurants near you, packages, grocery from your favourite stores, delivered to you at any time in the day or night. Download the app today and enjoy great deals and offers on grocery, food, medicines, vegetables, fruits, pizza, gifts and more.', 'Shivansh singh rajput', 'Others', '\"Yaru\" is a on demand service Using which customer can get anything from the local market done. Food, grocries,local courier, pickup and drop and little things like forgot your keys at home? We will get in done in less than 60minutes. Yaru follows multi sided business mofel which allow us to earn revenue from many users side. We dont own anything like bike fleet, we use Of local available resources like human and their motorcycles and offer them the idea of the company and attract them.', 'I_dont_have_any_investor_commitments_for_my_startup', '10lakhs', '2019-10-10 12:14:14', 'on', 'Jabalpur', 482002, 'Madhya Pradesh', ''),
