(124, '9997171078', 'kushmanish0107@gmail.com', 'The Tech World', 'Others', 'https://www.thetechworld.net', 'Other', '9', '2018', 'Founded in Oct 2018, The Tech World is a Digital solutions Company based in Jabalpur. We work in research & development of IT & Software products, for clients from different industries, to maximize their working standards by improving their production, quality, and thus the revenues by retaining their customer loyalty.\r\n\r\nWith technological advancements in the IT industry, The Tech World has developed and implemented IT strategies in different fields, especially in various sections of the trade \r\n\r\n', 'we are four member in our team:\r\n1. Munesh Kushwah\r\n2. Priyanshu Dwivedi\r\n3. Krishnakant Haldkar\r\n4. Suraj Gupta', 'B2C', 'For most the Internet is and has been just a medium. To a few it is and has always been the ultimate test of reinvention, the playground to test your own caliber, the track where it matters more to break your own record and the canvas to paint the unthinkable. That’s the spirit that Tekwrld was founded with by Munesh Kushwah and Priyanshu Dwivedi almost 3 years back. Today, that spirit remains the driving force for over a 10 plus professionals working under their leadership. That spirit is what ', 'Others', '5 lakhs', '2019-10-11 16:51:50', 'on', 'Jabalpur', 482005, 'Madhya Pradesh', ''),
(125, '8349492780', 'nanaksethh@gmail.com', 'JUST ORDER', '1', 'house no.11 bilhari mandla road jabalpur', 'Information Technology', '8', '2019', 'A smart e-menu and self-ordering system for Restaurants and fast food centers will allow their customers to self-order their food from their table using their mobile devices. OR the waiter in-charge can order for them. The bill for the food with be automatically generated with no human errors involved and problems like overbilling will not occur which seamlessly improves the customer experience at restaurants.\r\nside by side the order management system at the backend will smartly manage all orders', 'NANAK SETH-team leader and UI developer\r\nRAJUL VISHWAKARMA- Framework and functionality developer\r\nAMIT DEHERIYA - backend and database developer\r\nINSIA ZAIDI - Content  writer and digital marketing adviser\r\n', 'Others', 'the smart self-ordering system through customer mobile devices will end the tiring long queue system which may occur in most of the fast-food centers with high footfall. As the customer has to stand in rows for their turns for ordering and  a lot of time is wasted, but with self-ordering system customer can self order their food and can real-time track status for their food order from anywhere which  will help customer to get rid of these queues ', 'I_want_to_fund_raise_and_dont_know_what_to_do', '200000', '2019-10-13 18:36:43', 'on', 'JABALPUR', 482020, 'Madhya Pradesh', ''),
(126, '9650033190', 'satish@golocall.com', 'GoLocall ', 'Beta_Launched', 'https://golocall.com/', 'Information Technology', '6', '2018', 'Our tools act as an “Online Discovery Platform.” Whenever customers search for our Clients\' products/ services with intent to purchase, in search engines our Clients\' own Website shows up higher on all major search engines.\r\nThat means you will \"be found when your customers are searching. Get more website traffic and new customers. Get higher ranking, generate leads and increase revenue.\" \r\nThe business simply updates the website and our technology ensures it becomes discoverable and ranks higher ', 'Management Team: CEO & Co-Founder Satish Chaursiya Director, CTO & Co-Founder Brij Mohan Negi, Operations Team Size- 4, Sales Team Size-3, Alliance Partner- 6, ', 'B2B', 'Customer’s dynamic website is up and live within 15 minutes.\r\nThe business simply updates the website and our technology ensures it becomes discoverable.\r\nGet higher ranking on all major search engines without relying on complicated, time-taking and expensive SEO service.\r\nThe customer can himself manage and update their website via mobile app or web portal.\r\nGoLocall products allow businesses to take more control of their own online presence through our AI-powered Local Search Optimisation technolo', 'I_want_to_fund_raise_and_dont_know_what_to_do', '500', '2019-10-21 15:43:23', 'on', 'Jabalpur', 482001, 'Madhya Pradesh', ''),
