(132, '8505980845', 'mrigansh.kul3@gmail.com', 'Serpentina Software Solutions', 'Beta_Launched', 'Serpentina Software Solutions', 'Information Technology', '3', '2019', 'Serpentina S/w Solutions is a SAAS Based Enterprise solution which aims at bridging the gap between humans and nature through technology.\r\n\r\nOur first product is an \"Interactive Flora Identification, Tracking and Maintenance solution using QR Codes.\"\r\n\r\nHow many times while going for a morning walk, you were curious: Oh wow! This plant looks so beautiful! I wish I could know more about them! Now imagine that information to be available on your smartphone by just scanning a QR Code :)', 'Deepa Kulshrestha\r\nEducation: M.Sc+M.Phil Environmental Science \r\nWork Ex: 23+ years in education and training for students\r\n\r\nManish Kulshrestha\r\nEducation: B. Arch\r\nWork Ex: 25+ Years in Wildlife Conservation, designing equipments for wildlife protection\r\n\r\nMrigansh Kulshrestha\r\nEducation: IT Engineer\r\nWork Ex: 5+ Years with multiple million dollars worth startups, as a co-founding member\r\n\r\nAnkit Gupta\r\nEducation: IT Engineer\r\nWork Ex: 4+ Years of programming world-class products used by millions of users', 'B2B', '21st Century is about exploring how technology can bring a positive impact on our lives. While there has been enormous development, some of the untapped sectors which we will focus on are biodiversity, wildlife and animal healthcare, ecotourism, agriculture, child & women health, tribal development & mining. \r\n\r\nA bunch of environmentalists, who have dedicated their lives for the cause and come with an entrepreneurial spirit, are coming together to create meaningful products for these sectors.', 'I_want_to_fund_raise_and_dont_know_what_to_do', '25', '2019-11-12 00:48:08', 'on', 'Jabalpur', 482001, 'Madhya Pradesh', ''),
(133, '9997171078', 'munesh6181@gmail.com', 'TechnoCrowd', 'Others', 'WWW.technocrowd.tech', 'Information Technology', '8', '2019', 'Founded in sept 2019, TechnoCrowd is a Digital solutions Company based in India. We work in research & development of IT & Software products, for clients from different industries, to maximize their working standards by improving their production, quality, and thus the revenues by retaining their customer loyalty.\r\n\r\nWith technological advancements in the IT industry, TechnoCrowd has developed and implemented IT strategies in different fields, especially in various sections of the trade.', 'There are three Team Members:\r\n1.Munesh Kushwah (Founder, Web Developer)\r\n2.Priyanshu Dwivedi ( App Developer)\r\n3. Tanit Mukherjee ( Digital Marketing )', 'Others', 'Different:\r\nSome challenges just need a collective mind, in order to solve them, and some tasks need to be delegated to someone who has better competencies in the specific area. Some projects are better for brainstorming across as many people as possible, too.\r\n\r\n\r\n', 'I_want_to_fund_raise_and_dont_know_what_to_do', '5 ', '2019-11-12 14:16:35', 'on', 'Jabalpur', 482005, 'Madhya Pradesh', ''),
