(138, '7693941817', 'info.nuclearmidia@gmail.com', 'Cloud busstand', '1', 'Plot no-03 krishna nagar', 'Information Technology', '11', '2014', 'Our in this idea singal point all (M.P) bus stand solution in customer finger our platform provide easy to use and operat to customer he  well known  bus stand facilities lick  cycle stand taxi service bhoj naalai So on ', 'Our team member professional and experienced person both are well educated and our team member time  punctual', 'Others', 'In our indian market no one provide that type of all-in-one  cloud bus stand services that time we will focus \r\nIn our M.P.  \r\nIn MP approx 53+ official bus stand but no one interconnect online platform and doesn\'t share any busstand facility information to  passenger but in our idea passenger get full information about bus stand facility', 'I_dont_have_any_investor_commitments_for_my_startup', '10', '2019-11-14 22:34:23', 'on', 'Jabalpur', 482002, 'Madhya Pradesh', ''),
