(140, '9098887210', 'edworkss19@gmail.com', 'Edworks', 'Early_Revenues', 'www.edworks.co.in', 'Social welfare and development', '0', '2019', 'As of now, we are into recruitment space of business, and looking forward to build common platform, to have both human and resources at the same point of time, from the services of lowest to the highest category', 'Currently, we are team of 12 people, all into recruitment business. Founded by 2 people, and rest are the employees.', 'Others', 'Our approach towards keep exploring and not getting satisfied is our key to grow. We were 2 people with ZERO Revenue, ZERO Database, & ZERO Clientele, that has led today to 75 Clients with team size of 12 members and Absolute revenue of 2 lac per month, with vision of achieve 5 lac revenue by end of March 2020.\r\n\r\nThat\'s all about our positive and aggressive approach, which makes us stand out differently.\r\n\r\nAll is done with self funding and loan from govt scheme and credit from known people. ', 'Others', '', '2019-11-15 10:58:58', 'on', 'Jabalpur', 482001, 'Madhya Pradesh', ''),
