(142, '8982260364', 'anvitsaxena89@gmail.com', 'plastic or planet', '1', 'https://www.linkedin.com/in/anvit-saxena-a43a08142/', 'Social welfare and development', '0', '2019', 'It is a smart dustbin which will recyle all the plastic which are used in day to day life in every house or shop it is just collected and thrown in any outer area of city so our idea of smart dustbin will be able to recycle the collected plastic instantly and convert it into a used good like sign board etc.\r\nour smart dustbin will heat up all the plastic and melt it and resize it into a useful shape which can be reuse in any manner and therefore all the plastics which are thrown in the soil.', 'Anvit saxena is the leader of the team and Ankit kushwah is the second lead and analyst.\r\n\r\n', 'B2C', 'As our project is for environment welfare through which all the poly bags which are thrown in soil or in water can be reduce and the idea of swatch Bharat will be continued.\r\nour dustbin is cost efficient and hence no small recycle machines are made which are portable and can instantly recycle the plastic. Our project is very useful for the future as day to day consumption of plastic is very harmful for environment and we all know what a plastic can do and how much plastic are produced every day.', 'I_dont_have_any_investor_commitments_for_my_startup', '5', '2019-11-16 01:49:32', 'on', 'Gwalior', 474005, 'Madhya Pradesh', ''),
