(150, '7014363823', 'hanuprakash33@gmail.com', 'Home Easy', '1', 'None Yet', 'Citizen Services', '9', '2019', 'Our venture is set to bring all the household services and Needs under one shed, like Maid for Cooking and cleaning,Plumber,Electrician,Carpenter,Painters etc. by making a network connecting and linking them under the one common platform, because these day its not easy to find them easily and are\'nt easily available, and its very basic needs for every house, so making them easily available at very cheap rate charges as per the work.All professionals will be from your local area and verified.', '1.)Ayushi Tiwari (President): ultimate responsibility for the corporation\'s activities, and signs off on contracts and other legally-binding action on behalf of the corporation.\r\n2.)Trusha Kanade(Operating and Managing Director):with managing the corporation\'s day-to-day affairs, the COO usually reports directly to the company.\r\n3.)Apurv Prakash Shrivastava(Treasurer and Financial Manager):will be responsible  for almost all of the corporation\'s financial matters.\r\n4.)Chaitanya Rai: Technical work.', 'B2C', 'Home Easy will be assuring the quality of the work. You can set the date and time as per your convenience for the job to be done.Professional can register themselves on the platform after going through the formalities and having their qualifications verified.It can create new job openings too.HOME EASY will be an on-demand home services app that brings home service professionals and customers on a single technology-driven platform. We will maintain the professionalism with respect to TIME.', 'Others', '0', '2019-11-18 18:35:51', 'on', 'Jabalpur', 482001, 'Madhya Pradesh', ''),
