(156, '7014363823', 'hanuprakash33@gmail.com', 'Fast-O-Bus', '1', 'None Yet', 'Citizen Services', '9', '2019', '“Fast-O-Bus” is a unique bus app that displays live Bus status and up-to-date schedules. This app/website will function online with low usage of the Internet or GPS. It is also packed with useful features such as destination, alarms, distance, and a speedometer\r\nFeatures:-\r\nSpotting Bus Accurately\r\nOnline Schedules\r\nCoach, Berth and Bus Platform numbers\r\nSuper-efficient in Battery, Data Usage and App size\r\nSeat Availability and Status by Entering the Bus No. or PNR.', 'Chaitanya Rai- Techincal and Web Developer\r\nApurv Prakash Shrivastava - Marketing and Business, Technical and App \r\n                                                       developer\r\nTrusha Kanade - Marketing skills and influencer, Management Skills and Technical.\r\nAyushi Tiwari - Coming up with new ideas and help it with the team, \r\n                                Speaking skills, and Technical', 'B2C', '1.)	In this, we are different by using this app and one of the unique features is that we provide a bus PNR no.\r\n By this no. You can find the exact location of the bus.\r\n2.) You can get all the information about the buses in the city.\r\n3.) By using this app costumers time and money both are saved.\r\n4.) We are different because we provide information area to area bus service which was not successfully implemented until now, with the exact location and details of the Bus.', 'Others', '0', '2019-11-24 23:26:02', 'on', 'Jabalpur', 482001, 'Madhya Pradesh', ''),
