(165, '8010818645', 'support@phonebanao.com', 'PhoneBanao.com', 'Beta_Launched', 'https://www.phonebanao.com', 'Other', '8', '2019', 'Phonebanao.com is an on-site mobile repairing service. Through this platform, the client can get their cell phone fixed at their doorsteps. On the off chance that the gadget can\'t be fixed at the client\'s area, we give free pick up and delivery service and fix the gadget at our service station.', 'Shivam Nema - Founder \r\n\r\nHaving experience of 14 years in mobile repairing is the expert technician for mobile fixing and effectively running a service outlet since 2012 in the Jabalpur territory. He is responsible for the operations at ground level.\r\n\r\nSarthak Dixit - Founder \r\n(CA Finalist) \r\n\r\nHe concocted this thought and believed there is an open entryway in this space and things are not done as must be. In perspective on his past experience as a part of the audit and taxation team at T.R Chadha', 'B2C', 'We have the first-mover advantage, no other organization of this industry has entered the city. The founder itself has the experience of 14 years in mobile repairing and understands the business and client\'s expectations as he is already running service station since 2012. Because of the expanding utilization of cell phones in tier-III cities and urban areas. Our initial target audience will be of tier-III cities and urban areas in Madhya Pradesh.', 'I_want_to_fund_raise_and_dont_know_what_to_do', '1000000', '2019-12-06 15:54:15', 'on', 'Jabalpur', 482002, 'Madhya Pradesh', ''),
(166, '8208664627', 'shrikant@golocall.com', 'Golocall Web Services Pvt Ltd', 'Early_Revenues', 'www.golocall.com', 'Information Technology', '1', '2018', 'Our tools act as an “Online Discovery Platform.” Whenever customers search for your\r\nproducts/ services with intent to purchase, in search engines your own Website shows up\r\nhigher/ on first page of search engines.\r\nThat means you will \"be found when your customers are searching. Get more\r\nwebsite traffic and new customers. Get higher ranking, generate leads and increase\r\nrevenue.\"\r\nThe business simply updates the website and our technology ensures it becomes\r\ndiscoverable  and provides higher ranking ', 'Brij Mohan Negi- Founder\r\nSatish Kumar - Director \r\nChandra Mohan Negi- CFO\r\nGiriraj Singh Bisht- Marketing Head\r\nShrikant Vishwakarma- Operation Head (Business & Communication)\r\n', 'B2B', 'GoStag - “Online Discovery Platform” packaged as a dynamic website, with integrated e-commerce solution and Ai-Powered Local Search Optimisation technology, all into one easy to use platform', 'I_want_to_fund_raise_and_dont_know_what_to_do', '200', '2019-12-06 18:32:59', 'on', 'Jabalpur', 482001, 'Madhya Pradesh', ''),
