(171, '7368960909', 'tanzeelalam29@gmail.com', 'Wuzi', 'Proof_of_Concept', 'Hall of Residence 4, IIITDM', 'Citizen Services', '10', '2019', 'We plan to develop an app GullyBuddy that ensures personal safety when you are travelling in unknown or unsafe places. People who travel alone encounter a variety of problems ranging from theft, snatching, kidnapping, robbery to even rapes and murders.\r\nOur app will be a complete solution to the problem of safety while travelling alone. GullyBuddy, like a shadow companion, will accompany you whenever you travel to places. Anybody will have access to the app anytime they feel a need for company.', 'We are a team of 5 from IIIT Jabalpur.  Four of us are from CSE branch and one of us is from ECE branch. We are a balanced team as some of us love to take care of the technical aspects of things and others love to look after the managerial aspects. Through our app, we want to provide a complete solution to the problem of safety during solo travel.', 'B2C', 'Though there are a few safety apps available to tackle this issue, so far no app has proven to be even a satisfactory solution to the problem of safety while travelling.\r\nSome of the apps focus on evidence collection, others only on manually sending SOS alerts but so far, no app offers a complete solution which includes everything ranging from automatically sending messages to contacts in case of emergency to being interactive, from providing the safest path to detecting distress sounds.', 'I_dont_have_any_investor_commitments_for_my_startup', '45', '2020-01-21 21:15:41', 'on', 'Jabalpur', 482005, 'Jharkhand', ''),
