(173, '6396727527', 'founders@bindrr.me', 'Bindrr', 'Proof_of_Concept', 'https://angel.co/bindrr_me', 'Other', '11', '2019', 'Bindrr is an augmented reality based social network that completely changes the way people socialize and consume entertainment by using the physical world around us and bringing digital experiences to it. Bindrr will allow users to drop media in the real world (be it a building, a street, a house, or anything) for others to interact with them using their smartphone camera.', 'Anchil Kumar, Founder, pursued B.Tech in CS at Quantum Global Campus. He is talented at Business development and brand management.\r\n\r\nAbhinay Gupta, Co-founder, pursued B.Tech in CS at Quantum Global Campus. He is talented at Product development and management.\r\n\r\n', 'B2C', 'Our competitors include Snapchat, Twitter, Instagram, ZestReality, HearMeOut.\r\n\r\nOur USP is our use of Augmented reality as the main medium through which entire activity across the social network will take place.', 'I_want_to_fund_raise_and_dont_know_what_to_do', '40-50 ', '2020-01-24 05:39:22', 'on', 'Chandigarh', 160019, 'Chandigarh', ''),
