(183, '8839310502', 'Shivamgolhani@yahoo.com', 'trybo', '1', 'http://trybuy.in/', 'Other', '5', '2019', 'Trybo is an e-commerce marketplace founded in June 2019, which will provide delivery to the customer within 4 hours at anywhere in India with ease of access of the product to the customer.', 'Shivam Golhani, co-founder and CEO of trybo fashtech Pvt ltd , an engineering graduate , owned an online shirting brand named try buy .\r\nRashi Sahu, co-founder, and CBO of trybo fashtech Pvt ltd experienced in digital marketing and growth hacking.\r\n', 'B2C', 'Trybo will provide delivery within 4 hours in India with same day exchange and return facility', 'I_dont_have_any_investor_commitments_for_my_startup', '5000000', '2020-02-18 15:58:10', 'on', 'jabalpur', 482003, 'Madhya Pradesh', ''),
