(185, '7736630180', 'superrgau@gmail.com', 'Super Gau', '1', 'NA', 'Agriculture', '11', '2019', 'A kit for veterinary purpose, which aids the veterinarian to handle large animals during field work and also assist them in the process of measuring quantitative data such as weight, length etc. The crux feature to the product  is that it  helps the Veterinarian to raise the animal from ground level for inspection and surgery in filed. Thus, lowering the stress, as the surgeries  might take 3-4 hours and doctors have to sit on the ground stooping forward for the surgery.', 'Ashwath Nambiar - Mechanical Engineer, Currently pursuing Master of design at IIITDM Jabalpur.\r\nRajat Kamble - Mechanical Engineer, Currently pursuing Master of design at IIITDM Jabalpur.\r\nHarshit Sharma - Electrical Engineer, Currently pursuing Master of design at IIITDM Jabalpur.', 'B2B', 'Currently there are no products as such which is potable and compact, that can raise the animal from ground without human effort. There are pneumatic beds in market which is used in hospitals. But these cannot be take for the field work. The weight of animal is conventionally measured with the help of formulas only. Digital measuring device in our product can measure the weight while it is being raised. For handling the animal, there usually require 2-3 people as helping aids for veterinarian. ', 'Others', '5', '2020-02-23 01:47:26', 'on', 'Jabalpur', 482005, 'Madhya Pradesh', ''),
(186, '8770868183', 'creartsindia@gmail.com', 'CreArts India', 'Beta_Launched', 'www.creartsindia.com', 'Other', '1', '2019', 'CreArts India is a platform where we promote artists pan India and give them a platform to showcase their skill. Helping them grow, putting out relevant competitions and rewarding them. The main goal is to make a platform where people come in and search artists, designers, content writers, photographers and hire them directly from the website, not the other way around.', 'The whole concept is virtual, so I have a team member working with me remotely from other city, From replying to the emails, responding to the forms, managing data of 400+ people and their artworks, posting on time, designing, marketing everything was divided equally. ', 'B2C', 'Its a Blue Ocean. Nobody is doing what we are doing as of now in India. ', 'I_dont_have_any_investor_commitments_for_my_startup', 'No idea', '2020-02-24 00:23:07', 'on', 'Jabalpur', 482001, 'Madhya Pradesh', ''),
