(190, '8225936185', 'prashantj3010@gmail.com', 'Salgrow', '1', 'Jabalpur', 'Information Technology', '0', '2020', 'Salgrow is a professional business network for retailers, wholesalers, agencies and companies where Orders, Sales and Payment collections can be digitally managed & professionally cross connected and can track their sales and revenues to grow enormously. ', 'Salgrow is a idea of mine Prashant Jain a young entrepreneur started my own web & mobile app development firm in year 2014 in order to deliver the best solutions to my clients and started my own Property portal and Matrimony App for Jain Community which was first in its verticals dedicated for Jains and people responded well to my these small startups. \r\nPrior to my startup I worked in IT Telecom Sector for 9+ years in different companies & cities and got industry working experience.', 'B2B', 'The professional retail/wholesale business network is being introduced first time in industry. Currently all transactions digitally managed by individual companies as per their requirement and which is quite costly.  Salgrow is an affordable solution for all kinds of business owners small or big along with a professional network which helps multiplying the growth & day to day operations.', 'I_want_to_fund_raise_and_dont_know_what_to_do', '30', '2020-03-04 21:06:51', 'on', 'Jabalpur', 482002, 'Madhya Pradesh', ''),
