(196, '9977418764', 'loknath.deshmukh3108@gmail.com', 'SOFT GOLD CULTIVATION', 'Others', 'www.dicrdvv.org.in', 'Healthcare', '7', '2019', 'Restorative mushrooms are critical with regards to characteristic recuperating systems. The family Cordyceps is refers to a growth which develops on creepy crawlies. It\'s a widely utilized variety of uplifting mushrooms for treating contagious and critical diseases. \r\nIn spite of the fact that, there are various species which lie down under the family Cordyceps Sp. that as it may, C. militaris has been upgraded for in vitro development for their fruiting body. ', 'Collaboration with Bio-Design Innovation Centre, Jabalpur (M.P.) India. ', 'B2B', 'Our optimized conditions and quality research & development related to productivity for Health and pharmaceutical Industries for society are well designed, novel, safe  and commercially important. ', 'I_dont_have_any_investor_commitments_for_my_startup', '5,00,000', '2020-03-19 19:02:39', 'on', 'Jabalpur', 482001, 'Madhya Pradesh', ''),
(197, '8839183504', 'thechazeindia@gmail.com', 'Chaze ', 'Steady_Revenues', 'www.chaze.in', 'Citizen Services', '11', '2019', 'Chaze is a hyper local e-commerce platform where we deliver Groceries, fruits, vegetables , Bakery products, stationary, cosmetics, raw chicken etc. From local shops of jabalpur within an hour.', 'Jayant dawani - business developer and maintaining public relations.(2yr experience)\r\nHarsh dixit - business developer and maintaining chaze operations (2yr experience)\r\n\r\nShubham Vishwakarma - Business development and Android app developed - IIT dhanbad\r\nNaveen kumar - Database management and Backend developer  IIT dhanbad\r\nShubham Maurya - Maintaning Finance and Web developer IIT Dhanbad\r\nPrakhar Pandey - Doing Marketing and Web developer IIT Dhanbad \r\n', 'B2C', 'We are working for the benifits of local shops keeper by providing all the technical support so that they can compete and stand with e-commerce by building a hyper local e-commerce platform in every city.', 'Others', '20 lakh ', '2020-03-28 12:38:29', 'on', 'Jabalpur', 482002, 'Madhya Pradesh', ''),
