(225, '7771068574', 'shivambhatt569@gmail.com', 'Bioplastics and biodegradable bags', '1', 'NA', 'Other', '0', '2020', 'Plastic has become an unavoidable part of our lives in the past three decades or so. As we know, eliminating it is quite difficult, although half of the world is struggling to encounter this threat with reasonable and pragmatic solutions. our main focus is to resolve this global problem nowadays, an alternative to petroleum-based plastic carry bags/films have been introduced i.e. compostable plastics (100% bio-based)carry-bags/films conforming government of India also encourage the use of it.', 'Production of biodegradable plastics is mainly dependent upon scientific research & development. In India, the government and some other research institutes are already working in this direction. For my startup, we will take primarily  R&D support from CIPET(central institute of plastics engineering and technology). Apart from that for production and business development, we will append qualified folks as per business requirement.', 'B2C', 'This new technology produces plastic which degrades by a process of OXO-degradation. The technology is based on a very small amount of degradant additive being introduced into the manufacturing process, thereby changing the behaviour of the plastic it does not just fragment but will be consumed by bacteria and fungi after the additive has reduced the molecular structure to a level which permits living microorganisms access to the carbon and hydrogen. It is therefore \"biodegradable.\" ', 'Others', '', '2020-06-17 20:30:16', 'on', 'itarsi', 461111, 'Madhya Pradesh', ''),
(226, '8839799621', 'rentobro@gmail.com', 'Rentobro', 'Proof_of_Concept', 'www.rentobro.com', 'Citizen Services', '10', '2019', 'Rentobro.com is an online Broker Free Rental Platform. We help Landlords and Tenants to connect directly using our platform along with End to End Solution and no broker’s Involvement. We don’t charge any Brokerage from our Tenants. Rentobro comes into existence to bring the whole rental world online by simplifying the renting process through Innovation & Technology.', 'Siddhartha shekhar \r\nEx bol biryani, Gear Up marketing', 'Others', 'we are different from no Broker .\r\nHere are some examples \r\n1.  no broker is targeting tier I city and we are targeting tier 2-3 city In next 3 year.\r\n\r\n2. No broker Model work for short time agreement only with owner and we have short/long term agreement with our owner.\r\n\r\n3. No broker do not Give Tenant replacement But we are Giving.\r\n\r\n4. No Broker Dont have booking Facility but we have, Tenant can gain cashback .\r\n\r\n5. No brokers charge From Tenant but we don\'t.\r\n\r\n', 'I_want_to_fund_raise_and_dont_know_what_to_do', '25', '2020-06-20 11:58:16', 'on', 'Jabalpur', 482001, 'Madhya Pradesh', ''),
