(266, '9926800618', 'prateek@wanderlooms.com', 'Wanderlooms', 'Early_Revenues', 'https://www.wanderlooms.com/', 'Citizen Services', '8', '2019', 'Wanderlooms is a travel enthusiast merchandise store with a product line of t-shirts, hoodies, buffs, mugs, sippers, stickers, etc.  The store caters to the specific niche of the audience who are into traveling, adventure sports, road-trips, motorsports, etc. We aim to become a one-stop-shop for all of the user\'s travel needs, targetting the travel crowd and the ones who aspire to be a traveler. Wanderlooms do not just sell the design, but the story behind it backed by real & finest travelers.', 'We are a very small team of 5 people with 2 founders. Prateek Vats, the brain behind the idea has been a 100K Miles Biker on road across India & Pan-Asia. Wanderlooms was found when Prateek, with a vision to sell his travel experiences via designs, met Devashish, a startup enthusiast in 2019. Prateek has been into traveling since 2011 and is the man in action right from the concept of designs to targeting the audience. Devashish, on the other hand, works on the strategies and plan of actions. ', 'B2C', 'Every design that we launch is linked with a real-life story of the places and experiences which puts up the conviction for the end-user to not just buy it but feel the experience at the same time. Our expertise in understanding the taste of our target group has been a very big reason why we showed tremendous growth post-lockdown starting from 3rd week of May 2020 with INR.2000/- and growing to 21,000/-, 79,000/-, 111,000/- respectively for the month of June, July & August in sales revenue.', 'I_dont_have_any_investor_commitments_for_my_startup', '50', '2020-09-20 12:44:32', 'on', 'Bhopal', 462042, 'Madhya Pradesh', ''),
