(281, '6263671821', 'ajaykushwaha0710@gmail.com', 'websolve', 'Early_Revenues', 'gadarwara', 'Information Technology', '0', '2020', 'Websolve is a Leading Website Design,software Company in Madhya Pradesh,India. We at Professional Web Design and Development provide a wide range of Creative and Technical Full Web Solutions Our customer. Whether it is Developing a successful Ecommerce Stores, Creating a Corporate Business .', 'Our software development team uses a combination of proven methods and experienced global talent, ensuring we apply the right combination of resources to meet client needs. Our skills in design, development, testing and support help ensure our client realizes maximum benefit from their web investment. Specific skills include responsive design, HTML5 development, video player development, .NET framework development, multiple CMS expertise, PHP, CSS3, back end integration, and mobile application ', 'B2C', 'Software developers own the process of transforming data into an organized structure for a product such as a mobile app or website. As you tackle complex development projects to grow your business, you\'ll need the right partner for your needs.', 'Others', '5,00,000', '2020-11-06 16:06:46', 'on', 'GADARWARA', 487555, 'Madhya Pradesh', ''),
(282, '8454989789', 'rounak.agrawal@lawgicalstartup.com', 'Lawgical Startup', 'Steady_Revenues', 'www.lawgicalstartup.com', 'Other', '3', '2020', 'We are a Jabalpur (M.P.) based team of Company Secretaries having rich experience working with various kinds of businesses and startups. We provide services in the domain of Corporate Law related matters, Intellectual Property related matters, Insolvency and bankruptcy related matters, legal drafting and vetting services, marketing and branding solutions and content writing services. Our specialisation lies in becoming an integrated platform for all kinds of startup services.', 'Our leadership lies in the hand of two professionals Rounak Agrawal and Tanya Jain\r\nRounak is a Company Secretary and holder of All India 8th Rank in CS exams and have worked with PwC India for 2 years and after having a rich experience in PwC he has laid the foundation stones of Lawgical Startup\r\nTanya is Company Secretary and have worked with multiple consultancy firms and have a diverse experience of handling advisory services Along with the founders our team has 3 more associates', 'B2B', 'We are a digitized platform to provide legal and secretarial services, enabling Entrepreneurs to focus on their dream projects. One of the key factor with us is our affordable rates and 24×7 assistance to Entrepreneurs. Usually people who aspire to build a startup, give up on their dream projects due to complexities involved in statutory requirements and legal side of any industry, we make sure that they can focus on building your dream business and we handle all their legal work', 'Others', '10', '2020-11-18 18:50:23', 'on', 'Jabalpur', 482002, 'Madhya Pradesh', ''),
