(284, '7000901605', 'ceo@skillgenic.in', 'Skillgenic Academy', 'Steady_Revenues', 'https://academy.skillgenic.in/', 'Other', '4', '1999', 'It is beneficial to have theoretical knowledge, but it is essential to have practical knowledge. This is the ideology upon which the very foundation of SkillGenic Academy rests. Here at SkillGenic, the focus is on making the students accustomed to the ways of the corporate world so that they can be industry-ready. The students who come here think outside the box as they are exposed to various programs that facilitate their overall development.', 'At SkillGenic Academy, we have a big family of creative and innovative interns who work diligently to achieve every goal. Our interns are divided under various profiles, namely:\r\n•	HR\r\n•	Sales and Marketing \r\n•	Business Development \r\n•	Digital Marketing\r\n•	Market Research \r\n•	Operations\r\n\r\n', 'B2C', 'We know that students cannot afford to pay a hefty sum for professional training, that is why our endeavor is to provide them with an economic training module. We provide them with the appropriate exposure that they need to excel in the industry. They get the opportunity to work with various companies. Most of the recruiters are super enthusiastic about taking in such motivated and high-performing interns.', 'I_want_to_fund_raise_and_dont_know_what_to_do', '30', '2020-12-04 23:59:19', 'on', 'Jabalpur', 482001, 'Madhya Pradesh', ''),
(285, '9589547130', 'shashank.thool4444@gmail.com', 'Root', '1', 'Plot no. 44 sainik society road near sai barat, Shakti nagar jabalpur', 'Other', '5', '2020', 'I am not a technology trained person, yet I know how important data is in the present and future. I have an idea for social media like “Facebook” and “Google+”, hope you like it. I called it “Roots”\r\n“Roots” is look like same as “Facebook” or “Google+”, but a feature or option should be added to in “Roots” with that I can also see my relationship with others. Just like the option of “friends suggest” appears in Facebook, similarly show the option of relationship.', 'It\'s on idea level now ', 'Others', 'For example, when user A sees the profile of user B and clicks on the relationship option, then he will know what is relationship with user B. Suppose there is no relation, then if he/she/it is in the same city then than it will show \"citymate\", \"townmate\" if in same town, \"schoolmate\" if in same school, \"countrymate\" in a same country and finally \"earthmate\" if no any option match.\r\nHow will it work?  For this, we will give the option to the user to create their own \"family tree\", so that the us', 'I_dont_have_any_investor_commitments_for_my_startup', '10', '2020-12-12 16:23:28', 'on', 'Jabalpur', 482001, 'Madhya Pradesh', ''),
