(288, '7772895990', 'Devanshpriyadarshan2001@gmail.com', 'Quink Post', 'Proof_of_Concept', 'https://quink-post.herokuapp.com', 'Other', '0', '2020', 'A tech  based platform for exploring different kind of readable content, some graphical contents (i.e. memes, gifs, paintings, sketches, photographs) uploaded by creators all around the Globe. \r\nIt will also provide its original readable content such as transcribed interviews, written podcasts, magazines and our own articles and creations.\r\nThere will be a community section as well where user can share their thoughts and interact with others and can collaborate for work and can solve their queries', 'We have been knowing each others since 2 years. We have worked in lots of Freelancing Projects. We know each others weakness and strength. \r\n-> Devansh Priyadarshan (CEO, Founder) - Web Developer, Data Analyst. I have completed courses of Web Development from Stanford Online Program. Pursing B.Tech (3rd Year Student) from Indira Gandhi Engineering College, Sagar (MP). I had worked in Orions Tech for 6 months as an intern. I have the experience of Startups. I was the co-founder of theseku.com .   ', 'B2C', 'In general, creators approaches different platforms to create content but don’t get any benefits for doing it. The other companies are generating profit but are not sharing it with its users which is what makes us different from others. The users has to activate Google AdSense or has to do digital marketing on their websites to increase viewership which is not accessible for everyone.', 'I_want_to_fund_raise_and_dont_know_what_to_do', '2000000', '2020-12-21 05:13:26', 'on', 'Sagar', 470004, 'Madhya Pradesh', ''),
