(315, '9993903167', 'arvindchaure89@gmail.com', 'Padmapriya Technovat Pvt Ltd', 'Early_Revenues', 'www.pptech.in', 'Other', '3', '2018', 'We have launched two product with brand name ....Sun for All and WE.. waste to Earning.\r\nSun for All is innovative solar heat processor converting solar energy into thermal energy. This product has many domestic and commercial applications. We have also filed patent for the same \r\nWE... Waste to Earning is our model of solid waste management. This includes a innovative wet waste processor for managing waste at source. \r\nWe are also in  consultant of  waste water cleaning through Black to Blue. \r\n', 'Our team include Dr Anuradha Sharma who is a chemistry post graduate having wide knowledge  in certification of organic farming and teaching.\r\nArvind Chaure is post graduate in physics and management and having 15 years of experience working in corporate sector.\r\n', 'B2C', 'Two innovative patent filed products and experience professional team are our key strengths.', 'I_want_to_fund_raise_and_dont_know_what_to_do', '10lakh', '2021-02-20 16:56:22', 'on', 'Indore', 452001, 'Madhya Pradesh', ''),
(316, '8087880289', 'priyank@podnom.com', 'PodNom', '1', 'http://www.podnom.com', 'Other', '1', '2021', 'Podcasting is growing fast.  BakedIn/Host-read ads are the most popular ad format in podcasts. Total podcast ads spend is growing at more than 40% a year.\r\n\r\nAfter talking to multiple Podcasts and Brands, we understand discovering and transacting are biggest problems of the both parties involved.\r\n\r\nWe believe a digital marketplace where Brands and Podcaster can discover, talk and transact with each other will add a lot of value to both parties involved.', 'Our team is young, ambitious, curious and restless. We deeply believe in the problem and we are excited to be solving it. Our founder is an experience entrepreneur with his 1st startup CutShort.io (A hiring marketplace which uses AI/ML + SaaS product to solve inefficiencies in recruitment. It is used by 800,000+ users and 10,000+ companies) growing fast and currently being run by other co-founders.', 'B2B', 'In our team, we have experience of building multiple products from scratch and scaling a marketplace from 0 to 800,000 users. We have deep understanding of how network effects work and are well positioned to leverage it.', 'I_dont_have_any_investor_commitments_for_my_startup', '10', '2021-02-24 11:39:07', 'on', 'Jabalpur', 482002, 'Madhya Pradesh', ''),
