(318, '7987792752', 'legalwalletindia@gmail.com', 'Legal Wallet', 'Early_Revenues', 'Legalwallet.in', 'Other', '7', '2020', 'Legal Wallet primarily focuses on Financial Advisory, Audit and Assurance, Tax Consultancy and statutory compliance of a client into ‘One Wallet’. The company has demonstrated expertise in their respective areas. Our leadership is maintained through a commitment to best practice, string professional affiliations and continual development of our people, systems and services. Legal wallet way is to think outside of the box and to offer services to support the whole of your business ', 'Legal Wallet is a professionally managed company having team of distinguished Chartered Accountants, Company Secretary. Lawyers, Corporate Financial Advisors and Tax consultants.', 'B2B', 'Our motive is to provide legal, tax and financial consultancy ‘ Under one roof in one click ‘. We also aim at establishing a digital network and access for all legal needs by enhancing the economic well being of an organization by providing timely services which adds significant value to the client’s business.', 'I_dont_have_any_investor_commitments_for_my_startup', '5', '2021-02-25 13:38:02', 'on', 'Jabalpur', 482002, 'Madhya Pradesh', ''),
