(320, '9171571355', 'ipsysolution@gmail.com', 'i-psy', 'Proof_of_Concept', 'www.i-psy.in', 'Social welfare and development', '1', '2021', '\"i-psy\" is a holistic emotional wellness solution exclusively for students. Emotional Wellness has been defined as “an awareness of one’s emotions to manage challenges in life.” Thus, emotional self-awareness is the key to emotional wellness and a better life. Our vision is “to improve emotional wellness among students by promoting self-awareness”. We aim at scientifically assessing student’s personality and accordingly counselling them for changes that can be effected in their lifestyle.\r\n', 'The human resources from fields of psychology, academic mentoring and community medicine have been identified as the key pillars in the foundation of i-psy. \r\nKovid Verma, an MBA graduate from IIFM (Bhopal) & a student mentor is the founder. Seasoned clinical psychologists Dr Avantika Shrivastava and Dr Shraddha Tiwari constitute the core competency. Dr Nishant Mishra pursing MD from the Dept of Community Medicine and Dr Suyash Sharma work as Research Associates.  ', 'Others', 'We are the first enterprise in the region \r\n- to provide a platform for students and their mentors a scientific guidance on how to improve their self-awareness.     \r\n- to provide an extra edge to students appearing for campus placements and internships with regard to their compatibility for the same. \r\n- to become a repository of primary data and hence a platform for various descriptive and exploratory research with regard to preventative and promotive mental healthcare.', 'I_dont_have_any_investor_commitments_for_my_startup', '7', '2021-03-03 15:50:55', 'on', 'Jabalpur', 482020, 'Madhya Pradesh', ''),
