(327, '9764071161', 'thenewlaundry@gmail.com', 'Sweep Laundry Solutions', 'Early_Revenues', 'https://www.facebook.com/sweeplaundry/', 'Citizen Services', '2', '2020', 'A premium laundry and Dry cleaning service provider in Jabalpur\r\nCatering to both domestic and commercial market.\r\n\r\nOur services include:\r\n>Dry Cleaning\r\n>Steam Ironing\r\n>Roll Press\r\n>Shoe ,bag and leather laundry\r\n>Blankets, Mattress and heavy furnishings\r\n>Carpets, Rugs shampooing\r\n>Vacuum packaging\r\n>KG laundry for everyday clothes - wash + fold + iron\r\n', 'Out of team of 7 , we have 4 women. ', 'Others', 'We are first in Jabalpur to start a complete mechanized laundry that caters to both Domestic and Commercial Customers. We also cater to the garment industry for specialized washes. \r\n\r\nWe use only Green Chemicals \r\n\r\nWe extend complimentary pick up and drop\r\n\r\nOne stop solution for all your laundry and dry cleaning needs\r\n\r\nPremium services at affordable prices\r\n', 'Others', '1', '2021-04-01 17:53:21', 'on', 'Jabalpur', 482001, 'Madhya Pradesh', ''),
